import React from 'react'
import styled from 'styled-components';
const Container = styled.div`
    max-width: 1200px;
    width: 100%;
    margin: auto;
    padding: 0 2rem;
`;

const MainContainer = ({children}) => {
    return (
        <Container>{children}</Container>
    )
}

export default MainContainer
